Let's say you've got a little hello world program in a file hello.rs: fn main() { println!("Hello, world!");
} To turn this source code into an executable, you can use rustc: $ rustc hello.rs
$ ./hello # on a *NIX
$ .\hello.exe # on Windows Note that we only ever pass rustc the crate root , not every file we wish to compile. For example, if we had a main.rs that looked like this: mod foo; fn main() { foo::hello();
} And a foo.rs that had this: pub fn hello() { println!("Hello, world!");
} To compile this, we'd run this command: $ rustc main.rs No need to tell rustc about foo.rs; the mod statements give it everything that it needs. This is different than how you would use a C compiler, where you invoke the compiler on each file, and then link everything together. In other words, the crate is a translation unit, not a particular module.

