rustc supports a flag, --cap-lints LEVEL that sets the "lint cap level." This is the maximum level for all lints. So for example, if we take our code sample from the "deny" lint level above: fn main() { 100u8 << 10;
} And we compile it, capping lints to warn: $ rustc lib.rs --cap-lints warn
warning: bitshift exceeds the type's number of bits --> lib.rs:2:5 |
2 | 100u8 << 10; | ^^^^^^^^^^^ | = note: `#[warn(exceeding_bitshifts)]` on by default warning: this expression will panic at run-time --> lib.rs:2:5 |
2 | 100u8 << 10; | ^^^^^^^^^^^ attempt to shift left with overflow It now only warns, rather than errors. We can go further and allow all lints: $ rustc lib.rs --cap-lints allow
$ This feature is used heavily by Cargo; it will pass --cap-lints allow when compiling your dependencies, so that if they have any warnings, they do not pollute the output of your build.

